sys_variable_value.value:
(function execute(inputs, outputs) {

  function getPREVO(identifier, collector) {

    if (!identifier)
      return collector;

    collector.push(identifier);

    var result = {
      error: undefined,
      next: undefined,
    };

    var rest_message = 'PokeAPI v2';
    var rest_method = 'Pokemon Species';
    var sm = new sn_ws.RESTMessageV2(rest_message, rest_method);
    sm.setStringParameter("identifier", identifier);
    var response = sm.execute();

    result.error = response.haveError();

    if (result.error)
      return collector;

    var responseBody = JSON.parse(response.getBody());

    var nextURL = response.haveError() ||
        !responseBody ||
        !responseBody.hasOwnProperty('evolves_from_species') ||
        !responseBody['evolves_from_species'] ? '' : responseBody['evolves_from_species']['url'];

    if (!nextURL)
      return collector;

    var urlList = nextURL.split('/');
    result.next = (urlList[urlList.length - 2])+'';

    return getPREVO(result.next, collector);
  }

  outputs.prevos = getPREVO((inputs.identifier)+'', [])

})(inputs, outputs);

